function [sumP1, sumP2, sumP3] = cost_power_1(P1, P2, P3)
sumP1 = min(P2,P3) - P1;
sumP2 = min(P1,P3) - P2;
sumP3 = min(P1,P2) - P3;

function y = cost_power_1(PNPumps,sumP1, sumP2, sumP3)
powerVector = [sumP1, sumP2, sumP3];
[~,Npumps] = max([sumP1, sumP2, sumP3]);
if Npumps == PNPumps
    y = Npumps;
else 
    if abs(powerVector(Npumps) - powerVector(PNPumps)) > 10
        y = Npumps;
    else
        y = PNPumps;
    end

end
